import React from 'react';
import {add,sub,mult,div} from './Calc';
function App() {
    return (
        <>
            <ul>
                <li> The sum of two no is {add(40, 4)}</li>
                <li> The  of two no is {sub(40, 4)}</li>
                <li> The sum of two no is {mult(40, 4)}</li>
                <li> The sum of two no is {div(40, 4)}</li>

            </ul>
        </>
    );
}

export default App;
